import React,{useState} from 'react';
import {BrowserRouter, Routes, Route} from 'react-router-dom';

import './App.css';
import Home from './router/Home'


function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/'></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
